INSERT INTO `challenges` VALUES (1,'Autogestión de tratamientos','medium',NULL,NULL,1,'2025-11-04 23:30:45.718000','2025-11-06 18:30:01.853000',1,'?',50,'Don Humberto','Fue dado de alta con indicaciones médicas complejas, pero no entendió qué debía seguir tomando ni a quién acudir si se sentía mal.','Muchos errores médicos y complicaciones surgen al cambiar de un centro de salud a otro, por falta de continuidad y seguimiento personalizado.'),(2,'Obesidad','medium',NULL,NULL,1,'2025-11-04 23:30:45.727000','2025-11-06 18:30:01.859000',1,'⚖️',27,'Simona','Tiene una hija pequeña y trabaja tiempo completo. Sabe que la alimentación es clave, pero no ha podido organizar ni aprender a darle una nutrición buena a su hija.','Más de un 70% de la población en Chile presenta sobrepeso u obesidad (MINSAL). Esta situación se debe múltiples factores, entre ellos la falta de ejercicio y educación nutricional, disponibilidad de productos ultraprocesados y la desinformación.'),(3,'Envejecimiento activo','medium',NULL,NULL,1,'2025-11-04 23:30:45.734000','2025-11-06 18:30:01.868000',1,'?',72,'Juana','Vive sola desde que sus hijos se independizaron. Le gustaría mantenerse activa, pero no conoce programas accesibles que la motiven a hacer ejercicio, socializar y prevenir enfermedades.','La población chilena está envejeciendo rápidamente y muchos adultos mayores enfrentan soledad, pérdida de movilidad y falta de programas de prevención.'),(4,'Educación financiera accesible','medium',NULL,NULL,1,'2025-11-04 23:30:45.753000','2025-11-06 18:30:01.875000',2,'?',22,'Martina','Joven emprendedora de 22 años, vende productos por redes sociales. Aunque gana dinero, no sabe cómo organizarlo ni cuánto debe ahorrar o invertir, lo que lo mantiene en constante inestabilidad.','La ausencia de educación financiera en realidades económicas inestables dificulta la planificación y el uso responsable del dinero.'),(5,'Inicio de vida laboral','medium',NULL,NULL,1,'2025-11-04 23:30:45.760000','2025-11-06 18:30:01.883000',2,'?',23,'Andrés','Acaba de egresar de odontología. Le preocupa no poder trabajar pronto, pero ninguna clínica lo ha llamado porque no tiene experiencia previa.','Muchos estudiantes recién titulados enfrentan barreras para conseguir su primer empleo, ya que se les exige experiencia previa que aún no han podido adquirir.'),(6,'Tecnología adultos mayores','medium',NULL,NULL,1,'2025-11-04 23:30:45.766000','2025-11-06 18:30:01.889000',2,'?',70,'Osvaldo','Es un adulto mayor de 70 años y debe pedir ayuda a sus hijos o nietos cada vez que debe hacer tramites.','El avance tecnológico en los últimos años ha sido incremental. Esto ha beneficiado a múltiples sectores, sin embargo el conocimiento y adaptación para los adultos mayores ha sido una gran dificultad.'),(7,'Contaminación por fast fashion','medium',NULL,NULL,1,'2025-11-04 23:30:45.791000','2025-11-06 18:30:01.896000',3,'?',18,'Gabriela','Estudiante de 18 años que vive cerca de esta zona y debe pasar a diario por lugares con desagradables olores.','La moda rápida ha traído graves consecuencias al medio ambiente. Especialmente en sectores del norte de Chile en donde los vertederos y basurales están afectando el diario vivir de las personas.'),(8,'Acceso al agua en la agricultura','medium',NULL,NULL,1,'2025-11-04 23:30:45.798000','2025-11-06 18:30:01.903000',3,'?',50,'Camila','Agricultora de 50 años que cultiva paltas de exportación, ella está complicada de perder su negocio por la cantidad de agua que debe utilizar.','El agua dulce es un recurso natural fundamental para la vida. Hay zonas rurales en que el agua se ha hecho escasa.'),(9,'Gestión de residuos electrónicos','medium',NULL,NULL,1,'2025-11-04 23:30:45.804000','2025-11-06 18:30:01.910000',3,'♻️',29,'Francisco','Cambió su celular y computador el año pasado, pero no sabe dónde llevar los antiguos dispositivos. Terminó guardándolos en un cajón, como millones de personas que desconocen alternativas de reciclaje.','El aumento del consumo tecnológico ha generado toneladas de desechos electrónicos difíciles de reciclar.');
